import { Component } from "react";


class Car extends Component{

    constructor(){
        super();
        this.state = {color : 'Red'}
    }

    render(){
        return 
        <>
            <h1>My Car color is {this.state.color}</h1>
            <button onClick={()=>{this.setState({color:'Blue'})}}>Change Color</button>
        </>

    }
}


export default Car;
